	filea := &embedded.EmbeddedFile{
		Filename:    "public.html",
		FileModTime: time.Unix(1484706527, 0),
		Content:     string("<!DOCTYPE html>\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n  <head>\n    <title>neko rss mode</title>\n    <link rel=\"stylesheet\" href=\"/static/style.css\" />\n    <script src=\"/static/jquery.min.js\"></script>\n    <script src=\"/static/jquery.tmpl.min.js\"></script>\n    <script src=\"/static/underscore.min.js\"></script>\n    <script src=\"/static/backbone.min.js\"></script>\n    <script>\n      PUBLIC_VERSION = true;\n    </script>\n    <script src=\"/static/ui.js\"></script>\n    <meta name=\"viewport\" content=\"width=device-width\" />\n    <meta name=\"viewport\" content=\"initial-scale=1.0\" />\n  </head>\n  <body>\n\n      <div id=\"filters\">\n        <h1 class=\"logo\">neko</h1>\n        <p style=\"font-size: 10px;\">this is an rss aggregator</p>\n        <a href=\"/login/\">LOGIN</a>\n\n        <h4 onclick=\"$('#feeds').toggle();\">Feeds</h4>\n        <ul id=\"feeds\" style=\"display: none;\">\n        </ul>\n\n      </div>\n\n   <div id=\"c\">\n      <div id=\"items\">      \n      </div>      \n    </div>\n    \n    <script id=\"item_template\" type=\"text/jqtmp\">\n      <h3><a target=\"_blank\" class=\"i\" id=\"i_${item_id}\" href=\"${item.url}\">${item.title }</a></h3>\n        <p class=\"dateline\" style=\"clear: both;\">\n        ${ item.date } from <a href=\"${ item.feed.web_url }\">${ item.feed.title }</a>\n      </p>\n      <div class=\"description\">{{html item.description}}</div>      \n    </script>\n\n    <script id=\"tag_template\" type=\"text/jqtmp\">\n      ${tag.name} ${tag.unread}\n    </script>\n\n    <script id=\"feed_template\" type=\"text/jqtmp\">\n      <span class=\"txt\">\n      {{if feed.title}}\n      ${feed.title}\n      {{else}}\n      ${feed.url}\n      {{/if}}\n      </span>\n\n   </script>\n\n    <script id=\"controls_template\" type=\"text/jqtmp\">\n      <p>\n        <a {{if app.unreadFilter}}style=\"font-weight: bold;\"{{/if}} \n           class=\"unread_filter\">new</a>\n        &middot;\n        <a \n           {{if app.allFilter}}style=\"font-weight: bold;\"{{/if}} \n           class=\"all_filter\">everything</a> \n        &middot;\n\n\n       <a {{if app.starredFilter}}style=\"font-weight: bold;\"{{/if}}\n           class=\"starred_filter\">starred</a>\n      </p>\n      <button class=\"new_feed\">+ Feed</button>\n\n   </script>  \n   \n</body>\n</html>  \n"),
	}
